function switchLogo(){var o=-1;do{o=Math.floor(Math.random()*logoFonts.length)}while(o==logoValue);logoValue=o;updateLogo(logoValue)}function updateLogo(o){var t="images/gfx/logo_"+logoFonts[o]+".svg";var a=document.getElementById("primary");if(a){a.src=t}}var switchInterval=2e4;var logoFonts=["countdown","chromium","stop","data","babyteeth","quicksilver","marvin","pipeline"];var logoValue=Math.floor(Math.random()*logoFonts.length);updateLogo(logoValue);var logoTimer=setInterval(switchLogo,switchInterval);